import React from 'react';
import './App.css';
import {Route} from 'react-router-dom';
import Homepage from './Pages/Homepage/Homepage';

function App() {
  return (
    <div className="App">
      Yo yo yo
      <Route exact path="/" component={Homepage} />
    </div>
  );
}

export default App;
